import React from "react";
import {render} from "react-dom";
import { BrowserRouter as Router, Switch, Route, RouteComponentProps } from "react-router-dom";
import { Search } from './component/Search';
import { City } from './component/City';

const pointer = {
    cursor: "pointer"
};
const tdn = {
    textDecoration: "none"
};

const App = () =>(
    <>
    <div className="d-flex flex-column flex-md-row align-items-center p-3 px-md-4 mb-3 bg-white border-bottom shadow-sm" style={pointer}>
        <img alt="Weather" width="80px" src="data:image/png;base64," />
        <a href="/" style={tdn}><h5 className="my-0 mr-md-auto font-weight-normal">Weather</h5></a>
    </div>
    <div className="container pt-3">
    <Router>
            <Switch>
                <Route exact path="/">
                    <Search/>
                </Route>
                <Route exact path="/:idCity" component={
                    (props: RouteComponentProps<{ idCity: string }>) => <City idCity={props.match.params.idCity} />
                } />
            </Switch>
    </Router>
    </div>
    </>
);

render(<App />, document.getElementById('root'));
